import React from 'react'

interface IProps{

}
interface IState{
isloggIn:boolean;
}
class AuthUser extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
        this.state={
            isloggIn:false
        }

    }   
    logIn=()=>{
        this.setState(
            {
            isloggIn:true
            }
            )
    
}
logOut=()=>{
    this.setState(
        {
            isloggIn:false
        }
    )
}
        
   
    
    render()
    {
        return(
<React.Fragment>
<section>
    <div className='container'>
        <div className='row'>
            <div className='col-md-6'>
            
                <div className='card'>
                    <div className='card-body bg-light'>
                        <button className='btn btn-success btn-md'onClick={this.logIn}>Log In</button>
                        <button className='btn btn-danger btn-md'onClick={this.logOut}>LogOut</button>
                        <h4>Welcome User......</h4>
                <h4>Welcome guest.....</h4>
                        
                        
                    </div>
                </div>
            </div>
        </div>
    </div>
</section>
    
</React.Fragment>
        )
    }
};
export default AuthUser;
